import React from "react";

export default function NavBar () {

    let menu = document.getElementById('menu');

    const handleClick = () => {
        menu.classList.add("active");
    }

    const handleCross = () => {
        menu.classList.remove("active");
    }

    return <nav className="nav flex justify-between">
        <svg className="m-5" xmlns="http://www.w3.org/2000/svg" width="48" height="48"><g fill="none" fill-rule="evenodd"><circle cx="24" cy="24" r="24" fill="#FFF"/><path fill="#0B0D17" d="M24 0c0 16-8 24-24 24 15.718.114 23.718 8.114 24 24 0-16 8-24 24-24-16 0-24-8-24-24z"/></g></svg>
        <ul id="menu" className="menu w-2/3 h-screen fixed backdrop-blur-xl">
            <li><i onClick={handleCross} class="fa-solid fa-xmark"></i></li>
            <li>Home</li>
            <li>Destination</li>
            <li>Crew</li>
            <li>Technology</li>
        </ul>
        <svg onClick={handleClick} className="mt-8 mr-7 cursor-pointer" xmlns="http://www.w3.org/2000/svg" width="24" height="21"><g fill="#D0D6F9" fill-rule="evenodd"><path d="M0 0h24v3H0zM0 9h24v3H0zM0 18h24v3H0z"/></g></svg>
    </nav>
}
